Greatest Military Clashes

War Documentary hosted by Qarie Marshall, published by Discovery Channel in 2003 - English narration


Information
------------------------------

Watch as epic battles are waged on land and in the air to determine history's most powerful weapons of war. Four of the greatest fighters are pitted against each other in a series of tests to prove which is the fastest, most accurate, most powerful fighting machine. Pilots, gunners, and experienced vets put each weapon through its paces, measuring every technical aspect, then debate the real-world impact-how it actually fared in the field.

Produced by Darlow Smithson Productions for Five and Discovery Channel MMIII

1)  World War I 
Return to the skies of the Great War as England's Sopwith Camel-the most successful fighter of the war-takes on the Kaiser's unmistakable Fokker Triplane-a personal favorite of the Red Baron. In the countryside below, watch as two heavyweights trade blows-the formidable British 18-lb. field gun, dubbed the &quot;infantry killer,&quot; against the awesome German field Howitzer.

